INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 0.0, 110501, 24015, 4, 0.0, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 4.0, 110501, 24016, 1, 0.0, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 0.0, 110501, 24017, 4, 0.0, 3, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 5.2, 110501, 24018, 2, 0.0, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 4.2, 110501, 24019, 6, 0.0, 5, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 0.0, 110501, 24020, 2, 0.0, 6, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 6.4, 110501, 24021, 6, 0.0, 7, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 0.0, 110501, 24022, 2, 0.0, 8, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 10.08, 110501, 24023, 3, 0.0, 9, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 5.0, 110501, 24024, 2, 0.0, 10, "2030/12/17 14:59:59");
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 10021, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, "カオリ（サマー）", "2019/07/31 12:00:00", 24, 0.0, 110501, 24025, 2, 0.0, 11, "2030/12/17 14:59:59");
